function getEmbeddedPlayer(e,f,a){var d="";var c=e.match(/watch(.*)v=([a-zA-Z0-9\-_]+)/);var b=e.match(/youtu.be\/([a-zA-Z0-9\-_]+)/);var g=e.match(/^(http:|https:)\/\/(www\.)?vimeo\.com\/(clip\:)?(\d+).*$/);if(c){d='<iframe width="'+f+'" height="'+a+'" src="http://www.youtube.com/embed/'+c[c.length-1]+'?rel=0&wmode=transparent" frameborder="0" allowfullscreen>'}else{if(b){d='<iframe width="'+f+'" height="'+a+'" src="http://www.youtube.com/embed/'+b[1]+'?rel=0&wmode=transparent" frameborder="0" allowfullscreen>'}else{if(g){d='<iframe src="http://player.vimeo.com/video/'+g[4]+'" width="'+f+'" height="'+a+'" frameborder="0"></iframe>'}else{d=false}}}return d};